import {Spinner} from '../shared/Spinner'
import { useGetContact} from './_query/useGetAbout';

export const Conatact = () => {
  const {data, isLoading} = useGetContact()
  
  if(isLoading) return <Spinner/>
  return (
    <div >
   Conatact
    </div>
  );
}
